short int Buffer1[240][512]; // 240 rows, 512 (320 + padding) columns
short int Buffer2[240][512];


// 2nd index: [0] is most recent value, [1] is one frame ago, [2] is two frames ago
int titleX[3]; // x & y of the upper left corner of the 2x2 box
int titleY = 80;

//int dx, dy;
int dTitle = -8;
int finishRender = 0;
short int boxColor[8];
short int colors[10] = {0xffff, 0xf800, 0x7e0, 0x001f, 0xF81F, 0xFFE0, 0x07FF, 0x4380, 0x0384, 0x8384};

#define PS2_BASE 0xff200100
#define PIXEL_CTRL_BASE 0xff203020

#define KEYCODE_ENTER 0x5a
#define KEYCODE_S 0x1b
#define KEYCODE_I 0x43

int main(void) {

	titleX[0] = 90;
	titleX[1] = 90;
	titleX[2] = 90;
	int titleNumRows = sizeof(title) / sizeof(title[0]);
	int titleNumCols = sizeof(title[0]) / sizeof(title[0][0]);
	int move = 1;

    volatile int * pixel_ctrl_ptr = (int *) PIXEL_CTRL_BASE;

    *(pixel_ctrl_ptr + 1) = (int) &Buffer1; 
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	paintScreen(start_screen);
    vsyncWait();
    *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
	paintScreen(start_screen);
	
	waitForKey((char) KEYCODE_ENTER);

    while (1) {
		if (move) {
			if (titleX[0] <= 10) { 
				move = 0;				
			} else {
				titleX[2] = titleX[1];
				titleX[1] = titleX[0];
				titleX[0] += dTitle;

				paintScreen(start_screen);
				paintImg(titleX[0], titleY, 0, titleNumCols, titleNumRows, title);
			}
		}

		if (!move) {
			if (finishRender != 2) {
				paintImg(160, 50, 0, 120, 50, StartButton);
				paintImg(160, 110, 0, 120, 50, InstructionButton);
				finishRender++;
			} else {
				waitForKey((char) KEYCODE_S);
				clear_screen();
			}
		}
       	vsyncWait(); // swap front and back buffers on VGA vertical sync
    	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }
}

void waitForKey(char keyCode) {
	// poll for the "make" signal of a given key, and return when we get it
	volatile int *PS2_ptr = (int *) PS2_BASE;

	int PS2_data, RVALID;
	char inByte;
	while (1) {
    PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
    RVALID = PS2_data & 0x8000; // extract the RVALID field 
    if (RVALID) {
      inByte = PS2_data & 0xFF;
      if (inByte == keyCode) {
				return;
			}
    }
  }
}

void paintImg(int x, int y, int erase, int size_x, int size_y, const short int box_color[size_y][size_x]){
	if (erase) {
		for (int k = 0; k < size_y; k++) {
			for (int j = 0; j<size_x; j++) {
				plot_pixel(x+j, y+k, 65535);
			}
		}
	} else {
		for (int k = 0; k < size_y; k++) {
			for(int j = 0; j < size_x; j++){
				plot_pixel(x+j, y+k, box_color[k][j]);
			}
		}
	}
}

void vsyncWait() {
    volatile int * pixel_ctrl_ptr = (int *) PIXEL_CTRL_BASE;
    *pixel_ctrl_ptr = 1;
    int status = *(pixel_ctrl_ptr + 3) & 1;
    while (status != 0) {
        status = *(pixel_ctrl_ptr + 3) & 1;
    }
}

void paintScreen(const short int screen[240][320]) {
    for (int x = 0; x < 320; ++x) {
        for (int y = 0; y < 240; ++y) {
            plot_pixel(x, y, screen[y][x]);
        }
    }
}

int abs(int a) {
    if (a < 0) {
        return -a;
    }
    return a;
}

void clear_screen() {
    for (int x = 0; x < 320; ++x) {
        for (int y = 0; y < 240; ++y) {
            plot_pixel(x, y, 0);
        }
    }
}

void draw_line(int x0, int y0, int x1, int y1, int color) {
    char steep = 0;
    if (abs(y1-y0) > abs(x1-x0)) {
        steep = 1;
    }

    if (steep == 1) {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }
    if (x0 > x1) {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int dx = x1 - x0;
    int dy = abs(y1 - y0);
    int error = -(dx/2);
    int y = y0;

    int ystep = 1;
    if (y0 > y1) {
        ystep = -1;
    }

    for (int x = x0; x <= x1; ++x) {
        if (steep == 1) {
            plot_pixel(y, x, color);
        } else {
            plot_pixel(x, y, color);
        }
        error = error + dy;
        if (error > 0) {
            y = y + ystep;
            error = error - dx;
        }
    }
}

void swap(int *a, int *b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

void plot_pixel(int x, int y, short int line_color) {
    volatile short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    *one_pixel_address = line_color;
}